import React from "react";
import { useParams } from "react-router-dom";

import PlaceList from "../components/PlaceList";

const DUMMY_PLACES = [
  {
    id: "p1",
    title: "Brisbane Botanic Garden",
    description: "One of the most famous botanic garden in the Brisbane!",
    imageUrl:
      "https://images.pexels.com/photos/1322185/pexels-photo-1322185.jpeg?auto=compress&cs=tinysrgb&w=800",
    address: "152 Mount Coot-Tha Rd, Mount Coot-Tha QLD 4066",
    location: {
      lat: -27.4774246,
      lng: 152.9759935,
    },
    creator: "u1",
  },
  {
    id: "p2",
    title: "Brisbane Botanic Garden",
    description: "One of the most famous botanic garden in the Brisbane!",
    imageUrl:
      "https://images.pexels.com/photos/1322185/pexels-photo-1322185.jpeg?auto=compress&cs=tinysrgb&w=800",
    address: "152 Mount Coot-Tha Rd, Mount Coot-Tha QLD 4066",
    location: {
      lat: -27.4774246,
      lng: 152.9759935,
    },
    creator: "u2",
  },
];

const UserPlaces = () => {
  const userId = useParams().userId;
  const loadedPlaces = DUMMY_PLACES.filter((place) => place.creator === userId);
  return <PlaceList items={loadedPlaces} />;
};

export default UserPlaces;
